<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="utf-8">
   <meta http-equiv="X-UA-Compatible" content="IE=edge">
   <meta name="viewport" content="width=device-width, initial-scale=1, minimum-scale=1.0, shrink-to-fit=no, viewport-fit=cover">
   <meta name="description" content="FURY Network Docs">
   <title></title>

   <!-- Themes (light + dark) -->
   <link rel="stylesheet" media="(prefers-color-scheme: dark)" href="https://cdn.jsdelivr.net/npm/docsify-themeable@0/dist/css/theme-simple-dark.css">
   <link rel="stylesheet" media="(prefers-color-scheme: light)" href="https://cdn.jsdelivr.net/npm/docsify-themeable@0/dist/css/theme-simple.css">

</head>
<body>
  <div id="app"></div>
  <script>
    window.$docsify = {
      loadSidebar: true,
      subMaxLevel: 5,
      name: '',
      repo: ''
    }
  </script>
  <!-- Docsify v4 -->
   <!-- Required -->
   <script src="https://cdn.jsdelivr.net/npm/docsify@4.12.2/lib/docsify.min.js" integrity="sha384-xIN5egU/hhpWHJVYBHGJzMxw8THNdllJJglBceJSZISsQ4lp7IkHL4DoffRT1shZ" crossorigin="anonymous"></script>
   <script src="https://cdn.jsdelivr.net/npm/docsify-themeable@0.9.0/dist/js/docsify-themeable.min.js" integrity="sha384-ibjVZCUwWPrRrNc9BNkbbJvtYmTh8GYDNQgj+2jQVNDudOFgSQWs+Es6JhdoTIvf" crossorigin="anonymous"></script>

   <!-- Recommended -->
   <script src="https://cdn.jsdelivr.net/npm/docsify@4.12.2/lib/plugins/search.js" integrity="sha384-OuAu/NLU1JK8NXv0rMKuiz5MF/vd+WSLyjofN8o9Sq7GfUEQv0cTJv1XUyH1edMp" crossorigin="anonymous"></script>
   <script src="https://cdn.jsdelivr.net/npm/docsify@4.12.2/lib/plugins/zoom-image.min.js" integrity="sha384-gzUTSnp5UsD1seAQU58ztgYTnYfpodN+D3I89J1jQ4UTkDce0BEgtlgPKxa80uKc" crossorigin="anonymous"></script>
</body>
</html>
